

CREATE TABLE `account` (
  `accountid` varchar(45) NOT NULL,
  `password` varchar(100) NOT NULL,
  `usertype` varchar(45) NOT NULL,
  `firstname` varchar(100) NOT NULL,
  `middlename` varchar(100) DEFAULT NULL,
  `lastname` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `contactno` varchar(45) NOT NULL,
  `campus` varchar(45) NOT NULL,
  `status` varchar(45) NOT NULL,
  `datetime_created` datetime NOT NULL,
  `datetime_updated` datetime NOT NULL,
  PRIMARY KEY (`accountid`),
  UNIQUE KEY `accountid_UNIQUE` (`accountid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;




CREATE TABLE `appointment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `time_from` time NOT NULL,
  `time_to` time NOT NULL,
  `physician` varchar(200) DEFAULT NULL,
  `patient` varchar(45) NOT NULL,
  `type` int(11) NOT NULL,
  `purpose` int(11) NOT NULL,
  `chiefcomplaint` text DEFAULT NULL,
  `others` varchar(50) DEFAULT NULL,
  `med_1` int(11) DEFAULT NULL,
  `mqty_1` int(11) DEFAULT NULL,
  `med_2` int(11) DEFAULT NULL,
  `mqty_2` int(11) DEFAULT NULL,
  `med_3` int(11) DEFAULT NULL,
  `mqty_3` int(11) DEFAULT NULL,
  `med_4` int(11) DEFAULT NULL,
  `mqty_4` int(11) DEFAULT NULL,
  `med_5` int(11) DEFAULT NULL,
  `mqty_5` int(11) DEFAULT NULL,
  `sup_1` int(11) DEFAULT NULL,
  `sqty_1` int(11) DEFAULT NULL,
  `sup_2` int(11) DEFAULT NULL,
  `sqty_2` int(11) DEFAULT NULL,
  `sup_3` int(11) DEFAULT NULL,
  `sqty_3` int(11) DEFAULT NULL,
  `sup_4` int(11) DEFAULT NULL,
  `sqty_4` int(11) DEFAULT NULL,
  `sup_5` int(11) DEFAULT NULL,
  `sqty_5` int(11) DEFAULT NULL,
  `status` varchar(45) NOT NULL,
  `reason` text DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `patient_idx` (`patient`),
  KEY `type_idx` (`type`),
  KEY `purpose_idx` (`purpose`),
  CONSTRAINT `patient` FOREIGN KEY (`patient`) REFERENCES `account` (`accountid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;




CREATE TABLE `appointment_cc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `purpose` int(11) NOT NULL,
  `chief_complaint` varchar(200) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `purpose` (`purpose`),
  CONSTRAINT `appointment_cc_ibfk_1` FOREIGN KEY (`purpose`) REFERENCES `appointment_purpose` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=274 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




CREATE TABLE `appointment_physician` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `purpose` int(11) NOT NULL,
  `physician` tinytext NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




CREATE TABLE `appointment_purpose` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL,
  `purpose` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `type_idx` (`type`),
  CONSTRAINT `type` FOREIGN KEY (`type`) REFERENCES `appointment_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




CREATE TABLE `appointment_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;




CREATE TABLE `audit_trail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user` varchar(45) NOT NULL,
  `fullname` varchar(100) NOT NULL,
  `campus` varchar(45) NOT NULL,
  `activity` varchar(200) NOT NULL,
  `status` varchar(45) DEFAULT 'unread',
  `datetime` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_idx` (`user`),
  CONSTRAINT `user` FOREIGN KEY (`user`) REFERENCES `account` (`accountid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2192 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;




CREATE TABLE `campus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `campus` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;




CREATE TABLE `chief_complaint` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `chief_complaint` text DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;




CREATE TABLE `college` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
